import React, { Component } from 'react';
import logo from '../logo.jpeg';

class Header extends Component {
    render() {
        return (
            <div>
                <h1><a href=""><img src={logo} alt="FESTIVAL DE CANNES" /></a></h1>
                <ul>
                    <li>
                        <a href="">ALL</a>
                    </li>
                    <li>
                        <a href="">19</a>
                    </li>
                    <li>
                        <a href="">18</a>
                    </li>
                    <li>
                        <a href="">17</a>
                    </li>
                    <li>
                        <a href="">16</a>
                    </li>
                    <li>
                        <a href="">15</a>
                    </li>
                </ul>
            </div>
        );
    }
}

export default Header;
